import { render } from "react-dom";
import React from "react";

import App from "./App.js";

const PRODUCTS = [
      {
            category: 'Electronics',
            price: '19.99',
            stocked: true,
            name: 'Calculator',
      },
      {
            category: 'Outdoor Equipment',
            price: '49.99',
            stocked: true,
            name: 'Sleeping Bag',
      },
      {
            category: 'Clothing',
            price: '39.99',
            stocked: false,
            name: 'Jeans',
      },
      {
            category: 'Kids Toys',
            price: '19.99',
            stocked: true,
            name: 'calculator',
      },
]

render(<FilterableProductTable products={PRODUCTS} />, document.querySelector("#root"));
